INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'Love blurs your vision; but after it recedes, you can see more clearly than ever. It''s like the tide going out, revealing whatever''s been thrown away and sunk: broken bottles, old gloves, rusting pop cans, nibbled fishbodies, bones. This is the kind of thing you see if you sit in the darkness with open eyes, not knowing the future.',6,null,0,{ts '2015-12-01 12:12:58'});
