INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'I don''t want to see anyone. I lie in the bedroom with the curtains drawn and nothingness washing over me like a sluggish wave. Whatever is happening to me is my own fault. I have done something wrong, something so huge I can''t even see it, something that''s drowning me. I am inadequate and stupid, without worth. I might as well be dead.',6,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'If you knew what was going to happen, if you knew everything that was going to happen nextâif you knew in advance the consequences of your own actionsâyou''d be doomed. You''d be ruined as God. You''d be a stone. You''d never eat or drink or laugh or get out of bed in the morning. You''d never love anyone, ever again. You''d never dare to.',9,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'Longed for him. Got him. Shit.',null,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'Ignoring isnât the same as ignorance, you have to work at it.',8,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'But who can remember pain, once itâs over? All that remains of it is a shadow, not in the mind even, in the flesh. Pain marks you, but too deep to see. Out of sight, out of mind.',8,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'I read for pleasure and that is the moment I learn the most.',null,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'The only way you can write the truth is to assume that what you set down will never be read. Not by any other person, and not even by yourself at some later date. Otherwise you begin excusing yourself. You must see the writing as emerging like a long scroll of ink from the index finger of your right hand; you must see your left hand erasing it.',9,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'Perhaps I write for no one. Perhaps for the same person children are writing for when they scrawl their names in the snow.',null,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'We were the people who were not in the papers. We lived in the blank white spaces at the edges of print. It gave us more freedom. We lived in the gaps between the stories.',8,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'Stupidity is the same as evil if you judge by the results.',10,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'When you''re young, you think everything you do is disposable. You move from now to now, crumpling time up in your hands, tossing it away. You''re your own speeding car. You think you can get rid of things, and people tooâleave them behind. You don''t yet know about the habit they have, of coming back. Time in dreams is frozen. You can never get away from where you''ve been.',9,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'Falling in love, we said; I fell for him. We were falling women. We believed in it, this downward motion: so lovely, like flying, and yet at the same time so dire, so extreme, so unlikely. God is love, they once said, but we reversed that, and love, like heaven, was always just around the corner. The more difficult it was to love the particular man beside us, the more we believed in Love, abstract and total. We were waiting, always, for the incarnation. That word, made flesh. And sometimes it happened, for a time. That kind of love comes and goes and is hard to remember afterwards, like pain. You would look at the man one day and you would think, I loved you, and the tense would be past, and you would be filled with a sense of wonder, because it was such an amazing and precarious and dumb thing to have done; and you would know too why your friends had been evasive about it, at the time. There is a good deal of comfort, now, in remembering this.',8,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'Water does not resist. Water flows. When you plunge your hand into it, all you feel is a caress. Water is not a solid wall, it will not stop you. But water always goes where it wants to go, and nothing in the end can stand against it. Water is patient. Dripping water wears away a stone. Remember that, my child. Remember you are half water. If you can''t go through an obstacle, go around it. Water does.',11,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'Romance takes place in the middle distance. Romance is looking in at yourself through a window clouded with dew. Romance means leaving things out: where life grunts and shuffles, romance only sighs.',null,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'Love blurs your vision; but after it recedes, you can see more clearly than ever. It''s like the tide going out, revealing whatever''s been thrown away and sunk: broken bottles, old gloves, rusting pop cans, nibbled fishbodies, bones. This is the kind of thing you see if you sit in the darkness with open eyes, not knowing the future. The ruin you''ve made.',6,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'We still think of a powerful man as a born leader and a powerful woman as an anomaly.',null,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'You fit into me like a hook into an eye a fish hook an open eye',null,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'A truth should exist, it should not be used like this. If I love you is that a fact or a weapon?',null,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'Knowing too much about other people puts you in their power, they have a claim on you, you are forced to understand their reasons for doing things and then you are weakened.',6,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'How could I be sleeping with this particular man.... Surely only true love could justify my lack of taste.',12,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'Touch comes before sight, before speech. It is the first language and the last, and it always tells the truth.',13,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (2,'Better never means better for everyone... It always means worse, for some.',8,null,0,{ts '2015-12-01 12:12:58'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'Fairy tales are more than true: not because they tell us that dragons exist, but because they tell us that dragons can be beaten.',14,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'Have you ever been in love? Horrible isn''t it? It makes you so vulnerable. It opens your chest and it opens up your heart and it means that someone can get inside you and mess you up.',15,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'I''ve been making a list of the things they don''t teach you at school. They don''t teach you how to love somebody. They don''t teach you how to be famous. They don''t teach you how to be rich or how to be poor. They don''t teach you how to walk away from someone you don''t love any longer. They don''t teach you how to know what''s going on in someone else''s mind. They don''t teach you what to say to someone who''s dying. They don''t teach you anything worth knowing.',15,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'Sometimes you wake up. Sometimes the fall kills you. And sometimes, when you fall, you fly.',16,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'May your coming year be filled with magic and dreams and good madness. I hope you read some fine books and kiss someone who thinks you''re wonderful, and don''t forget to make some art -- write or draw or build or sing or live as only you can. And I hope, somewhere in the next year, you surprise yourself.',null,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'I can believe things that are true and things that aren''t true and I can believe things where nobody knows if they''re true or not. I can believe in Santa Claus and the Easter Bunny and the Beatles and Marilyn Monroe and Elvis and Mister Ed. Listen - I believe that people are perfectable, that knowledge is infinite, that the world is run by secret banking cartels and is visited by aliens on a regular basis, nice ones that look like wrinkled lemurs and bad ones who mutilate cattle and want our water and our women. I believe that the future sucks and I believe that the future rocks and I believe that one day White Buffalo Woman is going to come back and kick everyone''s ass. I believe that all men are just overgrown boys with deep problems communicating and that the decline in good sex in America is coincident with the decline in drive-in movie theaters from state to state. I believe that all politicians are unprincipled crooks and I still believe that they are better than the alternative. I believe that California is going to sink into the sea when the big one comes, while Florida is going to dissolve into madness and alligators and toxic waste. I believe that antibacterial soap is destroying our resistance to dirt and disease so that one day we''ll all be wiped out by the common cold like martians in War of the Worlds. I believe that the greatest poets of the last century were Edith Sitwell and Don Marquis, that jade is dried dragon sperm, and that thousands of years ago in a former life I was a one-armed Siberian shaman. I believe that mankind''s destiny lies in the stars. I believe that candy really did taste better when I was a kid, that it''s aerodynamically impossible for a bumble bee to fly, that light is a wave and a particle, that there''s a cat in a box somewhere who''s alive and dead at the same time (although if they don''t ever open the box to feed it it''ll eventually just be two different kinds of dead), and that there are stars in the universe billions of years older than the universe itself. I believe in a personal god who cares about me and worries and oversees everything I do. I believe in an impersonal god who set the universe in motion and went off to hang with her girlfriends and doesn''t even know that I''m alive. I believe in an empty and godless universe of causal chaos, background noise, and sheer blind luck. I believe that anyone who says sex is overrated just hasn''t done it properly. I believe that anyone who claims to know what''s going on will lie about the little things too. I believe in absolute honesty and sensible social lies. I believe in a woman''s right to choose, a baby''s right to live, that while all human life is sacred there''s nothing wrong with the death penalty if you can trust the legal system implicitly, and that no one but a moron would ever trust the legal system. I believe that life is a game, that life is a cruel joke, and that life is what happens when you''re alive and that you might as well lie back and enjoy it.',17,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'I hope that in this year to come, you make mistakes. Because if you are making mistakes...you''re Doing Something.',null,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'Have you ever been in love? Horrible isn''t it? It makes you so vulnerable. It opens your chest and it opens up your heart and it means that someone can get inside you and mess you up. You build up all these defenses, you build up a whole suit of armor, so that nothing can hurt you, then one stupid person, no different from any other stupid person, wanders into your stupid life...You give them a piece of you. They didn''t ask for it. They did something dumb one day, like kiss you or smile at you, and then your life isn''t your own anymore. Love takes hostages. It gets inside you. It eats you out and leaves you crying in the darkness, so simple a phrase like ''maybe we should be just friends'' turns into a glass splinter working its way into your heart. It hurts. Not just in the imagination. Not just in the mind. It''s a soul-hurt, a real gets-inside-you-and-rips-you-apart pain. I hate love.',15,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'Life is a disease: sexually transmitted, and invariably fatal.',null,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'Everybody has a secret world inside of them. I mean everybody. All of the people in the whole world, I mean everybody â no matter how dull and boring they are on the outside. Inside them they''ve all got unimaginable, magnificent, wonderful, stupid, amazing worlds... Not just one world. Hundreds of them. Thousands, maybe.',18,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'People think dreams aren''t real just because they aren''t made of matter, of particles. Dreams are real. But they are made of viewpoints, of images, of memories and puns and lost hopes.',null,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'What I say is, a town isn''t a town without a bookstore. It may call itself a town, but unless it''s got a bookstore it knows it''s not fooling a soul.',17,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'Stories may well be lies, but they are good lies that say true things, and which can sometimes pay the rent.',null,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'When I was a child, adults would tell me not to make things up, warning me of what would happen if I did. As far as I can tell so far, it seems to involve lots of foreign travel and not having to get up too early in the morning.',19,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'There are so many fragile things, after all. People break so easily, and so do dreams and hearts.',20,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'She says nothing at all, but simply stares upward into the dark sky and watches, with sad eyes, the slow dance of the infinite stars.',21,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'Tomorrow may be hell, but today was a good writing day, and on the good writing days nothing else matters.',null,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'Most books on witchcraft will tell you that witches work naked. This is because most books on witchcraft were written by men.',null,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'Being a writer is a very peculiar sort of a job: it''s always you versus a blank sheet of paper (or a blank screen) and quite often the blank piece of paper wins.',null,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'Things need not have happened to be true. Tales and dreams are the shadow-truths that will endure when mere facts are dust and ashes, and forgot.',22,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'She seems so cool, so focused, so quiet, yet her eyes remain fixed upon the horizon. You think you know all there is to know about her immediately upon meeting her, but everything you think you know is wrong. Passion flows through her like a river of blood. She only looked away for a moment, and the mask slipped, and you fell. All your tomorrows start here.',20,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'I hope you will have a wonderful year, that you''ll dream dangerously and outrageously, that you''ll make something that didn''t exist before you made it, that you will be loved and that you will be liked, and that you will have people to love and to like in return. And, most importantly (because I think there should be more kindness and more wisdom in the world right now), that you will, when you need to be, be wise, and that you will always be kind.',null,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'[D]on''t ever apologize to an author for buying something in paperback, or taking it out from a library (that''s what they''re there for. Use your library). Don''t apologize to this author for buying books second hand, or getting them from bookcrossing or borrowing a friend''s copy. What''s important to me is that people read the books and enjoy them, and that, at some point in there, the book was bought by someone. And that people who like things, tell other people. The most important thing is that people read... ',null,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'This is how you do it: you sit down at the keyboard and you put one word after another until its done. It''s that easy, and that hard.',null,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'I lived in books more than I lived anywhere else.',23,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'You get what anybody gets - you get a lifetime.',24,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'When we hold each other, in the darkness, it doesn''t make the darkness go away. The bad things are still out there. The nightmares still walking. When we hold each other we feel not safe, but better. "It''s all right" we whisper, "I''m here, I love you." and we lie: "I''ll never leave you." For just a moment or two the darkness doesn''t seem so bad.',25,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'In a perfect world, you could fuck people without giving them a piece of your heart. And every glittering kiss and every touch of flesh is another shard of heart youâll never see again.',20,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'Stories you read when you''re the right age never quite leave you. You may forget who wrote them or what the story was called. Sometimes you''ll forget precisely what happened, but if a story touches you it will stay with you, haunting the places in your mind that you rarely ever visit.',26,null,0,{ts '2015-12-01 12:15:08'});
INSERT INTO "QUOTES"."QUOTATION" (AUTHOR_ID,QUOTE_TEXT,Q_SOURCE,POSTING_USER,REPORTED,POSTING_DATE) VALUES (3,'I hope that in this year to come, you make mistakes. Because if you are making mistakes, then you are making new things, trying new things, learning, living, pushing yourself, changing yourself, changing your world. You''re doing things you''ve never done before, and more importantly, you''re Doing Something. So that''s my wish for you, and all of us, and my wish for myself. Make New Mistakes. Make glorious, amazing mistakes. Make mistakes nobody''s ever made before. Don''t freeze, don''t stop, don''t worry that it isn''t good enough, or it isn''t perfect, whatever it is: art, or love, or work or family or life. Whatever it is you''re scared of doing, Do it. Make your mistakes, next year and forever.',null,null,0,{ts '2015-12-01 12:15:08'});
